import React from 'react';
import { Nav, NavbarContainer, NavIcon, NavLogo } from './Navbar.elements';



const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer> 
                    <NavLogo to="/">
                    <NavIcon />
                    SIWH
                    </NavLogo>
                </NavbarContainer>
            </Nav>
        </>
    );
};

export default Navbar;
